import React from 'react';
import './App.css';
import SearchBar from './../SearchBar/SearchBar';
import SearchResults from './../SearchResults/SearchResults';
import Playlist from './../Playlist/Playlist';

class App extends React.Component{
  constructor(props){
    super(props);
    this.state = [
      {
        name: "Test",
        artist: 'Test Artist',
        album: 'Album one'
    },
    {
        name: "Test1",
        artist: 'Test Artist1',
        album: 'Album one'
    },
    {
        name: "Test2",
        artist: 'Test Artist2',
        album: 'Album one'
    },
  ]
  }
  render(){
    return (
      <div>
        <h1>Ja<span className="highlight">mmm</span>ing</h1>
        <div className="App">
        <SearchBar />
        <div className="App-playlist">
         <SearchResults />
        <Playlist />
        </div>
        </div>
      </div>
    )
  }
}

export default App;
